import { Button } from '@mui/material';
import React from 'react'
import "./TweetBox.css";
function TweetBox() {
  return (
    <div className="TweetBox">
        <div className='TweetBoxInput'>
            <input placeholder='Whats Happening?'></input>
        </div>
        <Button>
            Tweet
        </Button>
    </div>
  )
}

export default TweetBox
